import React from 'react';

const About: React.FC = () => {
  return (
    <div>
      <h1>About Me</h1>
      <p>Hello, my name is John Doe. I'm a software engineer with over 10 years of experience in the tech industry.</p>
      <p>I specialize in building web applications using technologies like React, Node.js, and TypeScript. I am passionate about creating intuitive, efficient, and scalable software solutions that drive business success.</p>
      <h2>My Background</h2>
      <p>I graduated from the University of Tech with a degree in Computer Science. After graduation, I worked at several tech startups, helping them to develop innovative products and grow their technology stack.</p>
      <h2>Skills</h2>
      <ul>
        <li>Web Development: React, Angular, Vue.js</li>
        <li>Backend Development: Node.js, Express, Django</li>
        <li>Database Management: MySQL, MongoDB, PostgreSQL</li>
        <li>DevOps: Docker, Kubernetes, AWS</li>
        <li>Others: Git, REST API, GraphQL</li>
      </ul>
      <h2>Hobbies</h2>
      <p>In my free time, I enjoy hiking, photography, and exploring new technologies.</p>
    </div>
  );
};

export default About;
